import * as React from 'react';
import Container from '@mui/material/Container';
import Nav from './component/Nav';
import CollapsibleTable from './component/Table/CollapsibleTable';
import SimplePaper from './component/Write/Write';
import { BrowserRouter, Route, Swich} from 'react-router-dom';



export default function App() {
  return (
    <BrowserRouter>
      <Container>
        {/* <ul>
          <li><a href="/">HOME</a></li>
          <li><a href="/topics">TOPICS</a></li>
          <li><a href="/pages">PAGES</a></li>
        </ul> */}
        <Nav  />
        <Swich>
          <Route><CollapsibleTable  /></Route>
          <Route><SimplePaper /></Route>  
        </Swich>
      </Container>
    </BrowserRouter>  
  );
}
